(2, NULL, 5, NULL, '。1966年にIUCN（国際自然保護連合）が中心となって作成されたものに始まり、現在は各国や団体等によってもこれに準じるものが多数作成されている。\r\nレッドデータブック', NULL, 0, 0, NULL, NULL, NULL, '2021-05-07 09:05:32'),
