(77, 104, 'ロイヤルアナロスタン', '2020-09-14', 21, '0000-00-00 00:00:00', 0, 'rsc/img/img_fn/y2020/m09/orig/20200914115208_uramachino1.jpg', 'シートン動物記「裏まちのすてネコ」に登場する野良猫。\n心が荒れすさんだ人間たちの中、たくましく生きる猫。人間に捕まって品評会に出場させられたことがある。\nロイヤルアナロスタンという名前は品評会に出された時の呼び名。', 5, 0, '', '::1', '2018-10-18 15:58:19', '2022-01-21 04:57:56'),
