(102, 1001, 'CatDog', '0000-00-00', 19, '0000-00-00 00:00:00', 0, 'rsc/img/img_fn/y2020/m09/orig/20200914153209_CatDog.jpeg', '半猫半犬のMAD生物。猫側の方は積極的、犬側はややひかえめ。アメリカのアニメ。主題歌が良い。', 17, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(103, 1002, 'ジョバンニ', '0000-00-00', 14, '0000-00-00 00:00:00', 0, 'rsc/img/img_fn/y2020/m09/orig/20200914133954_9ae6e0d5.png', '「銀河鉄道の夜」の主人公猫。孤独な少年。友人のカンパネルラと共に銀河鉄道の乗車し、様々な星を訪れる。', 9, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(104, 1003, 'フィリックス', '0000-00-00', 14, '0000-00-00 00:00:00', 0, '', '10円ガムで有名な猫。よく裁判になった。', 43, 0, '', '126.219.137.211', NULL, '2020-09-14 09:39:20'),
