(109, 0, '長靴をはいた猫', '0000-00-00', 10, '0000-00-00 00:00:00', 0, '', '軍師猫。策略に長けており権力者に取り入ったり、怪物を計略に陥れたりする。ついには主人を領主にすることに成功する。', 39, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(110, 0, 'トム', '0000-00-00', 21, '0000-00-00 00:00:00', 0, '', '包丁、斧、銃、爆弾、毒薬など各種危険物を扱う。よく薄っぺらになる。', 49, 0, '', '126.219.137.211', NULL, '2020-09-15 02:34:01'),
(111, 0, 'ミー', '0000-00-00', 0, '0000-00-00 00:00:00', 0, '', '多くの猫はこの名を持つ。', 42, 0, '', '126.219.137.211', NULL, '2020-09-15 02:34:26'),
(112, 0, 'リス猫', '0000-00-00', 0, '0000-00-00 00:00:00', 0, '', '今帰仁村で遭遇した猫。小さい体なのに、リスのような大きなしっぽを持った美しい猫。', 34, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(113, 0, 'ニャロメ', '0000-00-00', 21, '0000-00-00 00:00:00', 0, '', '赤塚作品に登場する猫。', 46, 0, '', '126.219.137.211', NULL, '2020-09-14 09:41:23'),
(114, 0, 'チャトラン', '0000-00-00', 19, '0000-00-00 00:00:00', 0, '', '映画、子猫物語に出てくる茶トラ。', 45, 0, '', '126.219.137.211', NULL, '2020-09-15 02:34:01'),
(115, 123, 'ニャース', '2020-02-02', 1, '2012-12-12 12:12:12', 0, '', '20年以上も黄色いネズミを追い求め続けている猫。', 25, 0, 'kani', '::1', NULL, '2022-01-21 04:57:56'),
(116, 0, 'スナネコ', '0000-00-00', 20, '0000-00-00 00:00:00', 0, '', '独特な表情で有名な野生のネコ', 21, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(117, 0, 'ミケ', '0000-00-00', 3, '0000-00-00 00:00:00', 0, 'rsc/img/img_fn/y2020/m09/orig/20200914141107_ur170801_nekoko07.jpg', 'FX狂いで借金まみれの猫。強制労働所で2兆年働くことになっている。お金にだらしがない猫だがいい猫である。勢い任せにFXに投資し続けるため「通貨」たちから心配されたり好かれたりしている。', 13, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(118, 950, '『吾輩』', '2020-09-15', 12, '0000-00-00 00:00:00', 0, 'rsc/img/img_fn/y2020/m09/orig/20200914113438_20100919_666548.jpg', '「吾輩は猫である」主人公猫。名前はまだない。観察力と語彙力がすごい。人間の言葉は話さないものの一般の人間以上の知性を備える。自分は人間の言葉を理解できるが、猫の言葉を人間は理解しないみたいな事を言っている。知性があるとはいえ猫であることをわきまえており、\"猫\"を踏み越えた行動をあまりしない。', 4, 0, '', '::1', NULL, '2022-01-21 04:57:56'),
(119, 0, 'フィガロ', '0000-00-00', 14, '0000-00-00 00:00:00', 0, '', '白黒のぶち猫。嘘つき人造人間に厳しい態度をとる。', 41, 0, '', '126.219.137.211', NULL, '2020-09-14 09:38:47'),
